import React, { useState, useEffect } from "react";

const Jackets = () => {
  const [jackets, setJackets] = useState([]);

  useEffect(() => {
    fetch("/api/jackets")
      .then((response) => response.text()) // Get the response as text
      .then((text) => {
        console.log("Raw response:", text); // Log the raw response
        const data = JSON.parse(text); // Parse the text as JSON
        console.log("Parsed jackets:", data); // Log the parsed data
        setJackets(data);
      })
      .catch((error) => console.error("Error fetching jackets:", error));
  }, []);

  return (
    <div>
      <h1>Jackets</h1>
      {jackets.length === 0 ? (
        <p>No products available.</p>
      ) : (
        <ul>
          {jackets.map((jacket) => (
            <li key={jacket.id} style={{ border: "1px solid #ccc", margin: "10px", padding: "10px" }}>
              <h2>{jacket.name}</h2>
              <p>Price: ${jacket.price}</p>
              <img src={jacket.image} alt={jacket.name} style={{ maxWidth: "100px" }} />
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Jackets;
